    "publisher_agencies": "ActionAid’s mission is to eradicate poverty and injustice www.actionaid.org.uk.  \r\n\r\nOur values include honesty and transparency. Our primary accountability is to people living in poverty and injustice, but we also balance our accountabilities to donors, supporters, staff and other stakeholders.    ActionAid UK’s income comes from a variety of sources including from our 135,000 individual supporters, trusts and foundations, and institutions like DfID, and the EU. Ongoing regular donations from the public represent a particularly critical element of our funding mix - both in terms of proportion of our global income, but also in terms of its potential for both transformational and focused change.  We use our funding mix holistically to deliver results in the communities in which we work.  In addition, we use unrestricted income for activities which support the International Secretariat which supports 46 countries across the ActionAid Federation. \r\n\r\nIn 2013 we raised £63.7 million, seeing a seven per cent increase in our income.  For every £10 of the money we raised, £7.54 was spent on our charitable activity – £7.00 on our activities overseas and 54 pence in the UK on education outreach to schools and on campaigning. Of the remainder, £1.85 was spent on fundraising and 61 pence on UK support costs. \r\n\r\n \r\nActionAid UK’s data that’s published to the IATI registry is summarised under the six categories above as this corresponds directly with our Trustee Report & Accounts for 2013 (and is therefore based on audited data): \r\n\r\nhttp://www.actionaid.org.uk/about-us/trustees-report-and-accounts.  \r\n\r\nAs we align our IATI reporting with our Trustee Report & Accounts, the bulk of our reporting to IATI is annual.  We report on DfID contracts quarterly.\r\n \r\n",
