    "publisher_units": "The organisation is structured with 5 district operational area, containing a series specific project, component, activity and sub activity beneath those. We will report to IATI up to 3 levels:                                                                                                          \r\n1. Top Level - Defined as \"Project\" (including information on full programme budget, and descriptions etc.)                             \r\n2. Middle  Level - Defined as \"Component\" are in nature of series and is an integral part of its parent project. These will contain more detailed information on financial transactions and specific geographic location and nature of the programme. Currently, BASE has defined 4 components on the basis of expected output, namely Advocacy, Education, Livelihood & Capacity building .                                                                                                                                                                                   3.lower Level-Defined as \"Activity\" corresponding to component's division and are detailed series of activities representing to its parent component with specific allocated financial cost and appraisal mechanism. Activities are designed on the need basis of component level requirement.",
    "publisher_contact": "Name of organisation: Backward Society Education (BASE)\r\nAddress: Rapti Zone, Dang District Tulsipur Municipality-6, Tulsipur, Nepal\r\nPhone No: 00977-82-520055, 522821\r\nEmail: info@nepalbase.org\r\n",
