    "publisher_thresholds": "There are no threshold for the projects.",
    "publisher_description": "With the support of local people and civil society organization, the movement against the bonded labour kicked off 1995 from Geta VDC of Kalali district- a far western district of Nepal. Five years after the struggle, the bonded labor system was officially abolished in Nepal following the government committed to rehabilitate and provide them compensation in terms of land, creation of employment opportunity and education for their children. This was a huge achievements for the ex bonded labour who were deprived of their rights and entitlements under various alibis for ages. Unfortunately, the lack of effective implementation of the commitment has remained a major challenge and as a result the great majority of ex bonded labour continue to suffer with no sign of relenting. Hence, the project jointly has implemented by the BASE as lead applicant and WVAF as partner organization have envisioned ameliorating the situation that has remained a long overdue. Moreover, the project will also contribute in achieving some of the goals of MDG by addressing the problem of ex-Kamaiya related with child labour and unemployment/underemployment through livelihood support, education, holding duty bearers to account and capacity building of Kamaiya leaders. It is implemented in five districts of Nepal.",
    "publisher_organization_type": "22",
    "publisher_record_exclusions": "There are no such exclusion on the DFID Funded projects data publication. So far, for any project, under joint collaboration with DFID and other donor(including Nepal Government's funding, if any), details of the project data pertaining to other donor's funding share than DFID would not be published. In case, if DFID requires for internal purpose or for IATI compliance, same can be made available after prior approval of the other respective donor on case to case basis.  ",
    "publisher_timeliness": "on the 28th day of February  2014, data would be sent. we will try our best on full IATI compliance as per our understanding and best of our knowledge within February 2014.",
    "publisher_source_type": "primary_source",
    "publisher_segmentation": "As total funding of the DFID is being solely for the single project \"NEKEPA\", we will report in the single file.",
