    "publisher_ui": "Specifically, no such user interface would be developed as of now, but we will provide in enough data/explanation/guidance note. if required, we will consider in collaborating with other agency to make our project data, status, efficiency as transparent as we can.",
    "publisher_agencies": "BASE continues in its commitment to fight against illiteracy, poverty and social and political discrimination amongst all marginalized communities.  Our aim is to transform the outlook of downtrodden people as well as their oppressors.  We currently operate in eight districts in the mid and far western regions of Nepal, those being Dang, Banke, Bardiya, Kailali, Kanchanpur, Salyan, Surkhet and Rukum.  However, we are now considering expanding our projects into other districts.  Our main areas of work include formal and non-formal education, ensuring and sustaining rights for freed-kamaiyas, livelihood support, child labor elimination, support for sustainable democracy, human rights violation monitoring, conflict mitigation, water and sanitation, environmental sustainability, disaster preparedness and response, infrastructure support, the protection and promotion of traditional and indigenous cultures, and support for children associated with armed groups.  BASE hires its staff primarily from the local communities of indigenous and marginalized people it serves, and in doing so it works to strengthen indigenous capabilities.  \r\nWe publish information of DfID funded GPAF initiative Project named Nepal Ex-kamaiya Education and Poverty Alleviation (NEKEPA). It includes the total cost along with the admin cost allocated on the basis of funding submitted on the proposal. The project is divided into 24 different activities on which each activity is on the stand alone basis and requires distinct cost. The project in total have 3 run-in period having above pinpointed 24 activities on required basis.",
