    "publisher_constraints": "To be confirmed.",
    "publisher_data_quality": "Data will be audited/verified.  Income will be based on revenue recognition rather than on cash received.  Expenditure will be the sum of direct and indirect costs.  All financials will be reported to IATI in GBP, although funding to CABI may be in other currencies.  Exchange rates are applied monthly, however the Value Date, and Transaction Date, will be given as the last date of the reporting quarter, for example 2015-03-31."
