    "publisher_constraints": "",
    "publisher_data_quality": "All data published through the Web API is verified and not likely to be subject to further change. All CERF allocation and contribution data available in its internal Grant Management System (GMS) is made available through a Web API. As of January 2016, all donor contributions to CERF, starting with the inception of the grant element in 2006, are available. Data on CERF allocations (in the form of grants and loans) is currently limited to 2014 onward pending the completion of data migration from a legacy IT system to the current GMS. "
