    "publisher_description": "Deltares is an independent institute for applied research in the field of water and subsurface. Throughout the world, we work on smart solutions, innovations and applications for people, environment and society. Our main focus is on deltas, coastal regions and river basins. Managing these densely populated and vulnerable areas is complex, which is why we work closely with governments, businesses, other research institutes and universities at home and abroad. Our motto is Enabling Delta Life. As an applied research institute, the success of Deltares can be measured in the extent to which our expert knowledge can be used in and for society. For Deltares the quality of our expertise and advice comes first.\r\n\r\nKnowledge is our core business\r\n\r\nAll contracts and projects, whether financed privately or from strategic research budgets, contribute to the consolidation of our knowledge base. Furthermore, we believe in openness and transparency, as is evident from the free availability of our software and models. Open source works, is our firm conviction. Deltares employs over 800 people and is based in Delft and Utrecht.\r\n",
