    "publisher_field_exclusions": "Field exclusions: Activity scope; location; recipient region; collaboration type; country budget items; planned disbursements; capital spend; conditions; legacy data.\r\nSome of these fields are not particularly relevant to the project activities or are not required by Free a Girl’s main donors. The location field is excluded due to safety and security reasons that may impede on the project activity if disclosed. \r\n",
