    "publisher_ui": "IATI data is not yet available on the Free a Girl website. ",
    "publisher_agencies": "Free a Girl \r\nDefence for Children International/ECPAT Netherlands\r\n\r\nPartner/implementing organisations: \r\nMaiti Nepal\r\nAssociação Barraca da Amizade\r\nBangladesh National Woman Lawyers Association (BNWLA)\r\nAssociação Maria Mãe da Vida\r\nRescue Foundation\r\n\r\n% total development flows covered by IATI data = 25.7% \r\nThis % is calculated based on Free a Girl's planned total expenditure on projects in 2015, as per the Annual Plan 2015. This percentage does not take into account Free a Girl’s costs related to overhead, fundraising, staff salaries, awareness raising campaigns, and marketing and communications. ",
