    "publisher_contact": "Pedro Almeida,\r\nInstitutional Funding Officer\r\nInternational Division,\r\nPerformance and Accountability Department,\r\n\r\nT:020 7877 7457,\r\nE: palmeida@redcross.org.uk,\r\n\r\nBritish Red Cross,\r\n44 Moorfields,\r\nLondon  EC2Y 9AL\r\nT:02078777952\r\nwww.redcross.org.uk \r\n\r\n\r\n",
