    "publisher_organization_type": "21",
    "publisher_record_exclusions": "British Red Cross does not commit to publishing project information on DFID funding to British Red Cross where funding is passed to the IFRC. British Red Cross will exclude documents that include information about personnel (e.g. MoUs) or confidentiality agreements automatically. Project expenditure will only be published to the extent that it is available in final documents (e.g. final narrative report or evaluation) rather than incrementally. British Red Cross reserves the right to exclude documents that we have agreed to publish should we conclude that publication would present a credible risk to the organisations or individuals involved, or where partners have reasonable objections, in particular where it might affect the ICRC's established working methods, including confidentiality.",
    "publisher_timeliness": "British Red Cross commits to publishing data for each new activity (i.e. project or programme fully and bilaterally funded by DFID) within three months of signing the MoU with DFID. Project updates will be published on an annual basis according to the time cycle of the activity.The raw data (XML format) file will be published and updated annually on IATI's registry. ",
