    "publisher_description": "The International Network of People who Use Drugs (INPUD) is a global peer-based organisation that seeks to promote the health and defend the rights of people who use drugs. INPUD will expose and challenge stigma, discrimination, and the criminalisation of people who use drugs and its impact on the drug-using community’s health and rights. INPUD will achieve this through processes of empowerment and advocacy at the international level, while supporting empowerment and advocacy at community, national and regional levels.\r\n\r\nINPUD is a movement of people who use drugs (current and former) who support the Vancouver Declaration. The Vancouver Declaration sets out the demands of people who use drugs, emphasising that their human rights must be respected and their health and wellbeing prioritised. INPUD is a global network that seeks to represent people who use drugs in international agencies such as the United Nations and with those undertaking international development work. We believe that people who use drugs should be meaningfully represented in decision-making processes that affect our lives. INPUD is committed to demonstrating at country level how people who use drugs can constructively contribute to the development and delivery of services for our community. We believe that we have a unique insight that can help money be spent wisely thus delivering better results for individuals and the wider community. We are asking the international community to stop always framing us as the problem and instead to recognise that we are part of the solution when is comes to addressing problems associated with drugs and drug policy around the world.",
