    "publisher_thresholds": "Projects with a total budget below € 25.000 are internally indicated as so called \"small projects\" and do not have to be published. A project manager can decide to publish this activity anyway.",
    "publisher_description": "Final objective of our organisation: ending AIDS and creating a world in which everybody has access to prevention, treatment, care and support for HIV and other sexually transmitted infections (STIs).\r\n\r\nMuch has been achieved in the past years, but we still need to overcome a large number of significant barriers. To continue playing a vital role in further curbing HIV and STI epidemics, both globally and in the Netherlands, we focus on what we are good at, namely:\r\n•\tFunding and developing innovative approaches and programmes;\r\n•\tImplementing programmes to address HIV and other STIs, and to promote sexual health in the Netherlands;\r\n•\tStrengthening civil society organisations;\r\n•\tAdvocating, nationally and globally; and\r\n•\tMobilising communities, the general public, and the private sector.\r\n\r\nWe work hard and join forces with others. We continue to ensure that the people affected are closely involved. In our work we focus special attention on vulnerable groups and the protection and improvement of their human rights. By critically monitoring and measuring the impact of our activities, we continue to enhance our approach. In this way, we come closer to reaching our final objective.",
    "publisher_organization_type": "21",
    "publisher_record_exclusions": "The rules for excluding data are defined in our Exclusion Policy. In general information is not published if it will harm security or privacy of individuals or partner organisations. Furthermore information will not be published if legal or contractual objections for publication exist.\r\n\r\nWe are aware that safe and appropriate collection and use of data to improve HIV programs for key populations is a critical topic. Thats why we develop a smart data strategy for dealing with the ethical, security and privacy challenges facing data-driven policy making and advocacy while minimizing risks and protecting human rights",
