    "publisher_units": "International activities are structured in two levels: programs and projects. In general, programs aim to overcome a crisis (e.g. Ebola), address a silent crises or prepare communities for future crises (disaster preparedness). Funding from donors is usually sought at the program level. These programs are then subdivided into one or multiple implementing projects. \r\nBoth levels of activities are published in the Netherlands Red Cross open data set. Programs are indicated with ‘hierarchy=1’, projects are indicated with ‘hierarchy=2’.  The relation between programs and the underlying projects can be found in the ‘related activity’ element. ",
