    "publisher_units": "For Plan UK grant-funded work, each \"activity\" will relate to a project, as defined within an internal \"Grant Agreement Document\" between Plan UK and the relevant Plan Country Office.  Where a country-level activity is part of a multi-country programme, we will provide information at the \"parent\" (overall programme) and \"child\" (specific country activity) level. This will be indicated within the \"Activity Description\" and \"Related Activity\" fields. For sponsorship funded work, an \"activity\" will be defined as Plan UK's financial contribution to the delivery of that Country's Strategic Plan.",
    "publisher_contact": "Open Information\r\nPlan UK\r\nFinsgate\r\n5-7 Cranwood Street\r\nLondon EC1V 9LH\r\nUK\r\n\r\nemail: openinformation@plan-uk.org",
