    "publisher_thresholds": "There will be no threshold for our initial publication of data on DFID-funded projects. For reporting on all other activities, once new IT systems provide automated access to project data, we will be able to report on all activities irrespective of value. If those systems are not fully in place by our target data for full IATI compliance by September 2013, our reporting will be limited to grants/ activities over US$100,000/ £60,000.",
    "publisher_description": "Plan International is a global children’s charity. We work with children in the world’s poorest countries to help them build a better future. A future you would want for all children, your family and friends.\r\n \r\nFor over 70 years we’ve been taking action and standing up for every child’s right to fulfil their potential by:\r\n- giving children a healthy start in life, including access to safe drinking water \r\n- securing the education of girls and boys \r\n- working with communities to prepare for and survive disasters\r\n- inspiring children to take a lead in decisions that affect their lives \r\n- enabling families to earn a living and plan for their children’s future \r\n\r\nPlan UK is the national office of the Plan International federation in the UK, providing fundraising and programming support to Plan International's work, and carrying out advocacy and campaigns in the UK.\r\n",
    "publisher_organization_type": "21",
    "publisher_record_exclusions": "We will exclude information on activities whose publication could endanger the security of the staff or assets of Plan or its implementing partners, or of the communities and children we work with. We will exclude some detailed budget/ unit cost information from project document whose publications would harm the commercial interests of Plan UK. Due to the prohibitive cost of publishing hiostorical data, we will publish only information on projects that are live at the time of publication. In line with Plan's Child Protection Policy, no data that could place individual children at risk of potential abuse or exploitation will be published. Donor names may be excluded under data protection requirements if private individual donors wish to remain anonymous, or if this is required under the terms of a contract with a donor. Exclusions are as per a draft organisational \"Open Information Policy\" scheduled to be approved in 2012.",
    "publisher_timeliness": "We will publish data on a quarterly basis, and will be able to publish a quarter in arrears. With IT system improvements being rolled out across Plan International country offices between April 2012 and April 2014, we will be able to reduce the amount of time in arrears that we will publish, but cannot currently state by how much that will be reduced.\r\n",
    "publisher_source_type": "primary_source",
    "publisher_segmentation": "For initial publication, due to the small number of individual DFID grants that we hold, we will publish all data in a single data file. By the time of full compliance, we would anticipate publishing separate data files for each Plan region, along with a separate multi-country programme data file. ",
    "publisher_frequency_select": "not_specified",
    "publisher_iati_id": "GB-COH-1364201",
    "publisher_ui": "We expect to have a new \"Open Information About Our Projects\" section on our website (www.plan-uk.org) in October 2012 through which data can be accessed.",
    "publisher_agencies": "Plan UK is a member of the federated organisation Plan International, whose programmes are implemented by an independent legal entity (Plan International Inc.). For IATI purposes, Plan International Inc and its country offices is treated as a separate funded institution and implementing organisation. Initially, Plan UK will report only on all DFID-funded projects. We will then move towards reporting data on all grants raised by Plan UK and implemented by Plan International Country Offices, and on sponsorship funds raised in the UK and disbursed via Plan International. Plan UK's reporting to IATI will not include reporting on the activities of Interact Worldwide, who are a subsidiary of Plan UK; Interact will publish IATI data independently.  We expect to publish on 95% of our programme spend. The 5% not covered is an initial estimate of the value of grants that may not be reported on under the terms of our exclusions explained below.\r\n",
    "publisher_constraints": "",
    "publisher_data_quality": "Organisational historical financial information will be externally audited. Project finances (data for which originates in country offices) will generally be internally verified by Plan UK programme and/ or finance staff. Project documents will be reviewed by Programme or Fundraising staff prior to publication."
