    "publisher_agencies": "For Plan International USA grant-funded work, each \"activity\" will relate to a project, as defined by the agreement with the donor agency. Where there is a percentage remaining with Plan International USA and in the case of multi-country activities, we will indicate the relationship using a parent (overall program) and child (specific activity per country) relationship and provide information on Plan International USA and the disbursement to the country office. We will use our internal \"Grant Agreement Document\" number as a supplemental ID. This will be indicated within the \"Activity Description\" and \"Related Activity\" fields. For sponsorship funded work, we foresee an \"activity\" as being defined as Plan US's financial contribution to the delivery of that Country's Strategic Plan. As further information on how IATI will work for private funding from individual giving is available, we may adjust this aspect.",
