    "publisher_country": "GB",
    "publisher_refs": "We currently publish sector information using our own vocabulary",
    "publisher_units": "An activity is an individual grant or contract, broken down by country or region of implementation. Transactions are aggregated quarterly from our financial system.\r\n\r\nThere is one archived activities data set. This contains closed awards that were not migrated to our new award management system.",
    "publisher_contact": "Save the Children UK\r\n1, St John's Lane\r\nLondon EC1M 4AR\r\nsavethechildren.org.uk\r\n",
    "publisher_contact_email": "",
    "publisher_field_exclusions": "Save the Children delivers life-saving assistance to children whose need is greatest, wherever they are. This means we work in some of the most complex, insecure, and fast-changing environments in the world, and as such the safety and security of our people and partners is paramount. Any information that compromises this – and merely confirming our presence in certain locations may be enough to do this – is excluded from our IATI publications. This means that some fields may be excluded on some activities. \r\n\r\nAs a rights-based organisation we have a commitment to safeguard children, especially those with whom we are in contact.  Therefore we will not publish any information that could identify an individual child.  More information can be found in our Child Safeguarding Policy.  \r\n\r\nWe may also exclude any politically or culturally sensitive information that may hinder our ability to operate in certain locations, or data that we cannot share for privacy, confidentiality, or wider regulatory or statutory reasons. \r\nSave the Children is also funded by corporate partners, community groups, and individual supporters.  Our Open Information Policy contains detailed guidance on how you can access information on these sources, and on why it may sometimes be impossible for us to share this for security, privacy, or confidentiality reasons.\r\n",
    "publisher_first_publish_date": "2012-10-02T00:00:00.000000",
    "publisher_url": "http://www.savethechildren.org.uk/",
    "license_id": "cc-by",
    "publisher_thresholds": "There are no thresholds set. ",
    "publisher_description": "Save the Children works in more than 120 countries. We give millions of children life-saving healthcare, nutritious food, protection from abuse, and the chance to go to school. When disaster strikes we do whatever it takes to save children’s lives. We work hard to give the poorest children in the UK a better start in life too – both at home and at school. And we challenge global leaders to keep the promises they’ve made to transform the world for children. Save the Children UK is a member of the global Save the Children movement, which is made up of 29 separate national entities. Our international programmes are designed in conjunction with national donors and implemented by Save the Children International.",
    "publisher_organization_type": "21",
    "publisher_record_exclusions": "See above.  The number of activities excluded in their entirety is negligible.  ",
    "publisher_timeliness": "Data is published within three months of end of quarter.",
    "publisher_source_type": "primary_source",
    "publisher_segmentation": "The majority of data is published as a single activities file, not segmented by country or region. \r\n\r\nWe publish the following data in separate activities files:\r\n1.\tOur 2011-2016 PPA information is published in SCUKPPA.XML \r\n2.\tSome completed legacy activities have been archived, and are published in the Activities - Archived dataset, to version 1.04 of the IATI standard. This covers published activities which closed before January 2014.\r\n",
    "publisher_frequency_select": "quarterly",
    "publisher_iati_id": "GB-COH-213890",
    "publisher_ui": "",
    "publisher_agencies": "Save the Children UK’s IATI data will cover all international grants and contracts received from institutional donors, subject to any necessary exclusions (see our notes on field and record exclusions below).  In our last financial year institutional funding represented approximately 70% of our total income.",
    "publisher_constraints": "We have provided all information that our systems currently permit as well as other data that we have been able to add within reasonable cost. Publication on certain activities may be pending, subject to official notification of donor permission. \r\n\r\nAs above, in our IATI publications an activity is an individual grant or contract, broken down by country or region of implementation. In our internal systems, multi-country grants and contracts are set up as internal ‘funding streams’ with ‘child’ awards for each country. We do this in order to facilitate financial reconciliations between country offices. Due to the way information is held within our systems, ‘parent’ funding streams and their child awards are all published as separate IATI activities, with their relationship indicated using IATI’s ‘related activity’ elements. The parent funding stream IATI activity will not have certain fields/elements (description, sector, recipient-country/region, document-link and records of expenditure). These are published on the child award’s IATI activity file only. In addition, incoming funds may only be recorded against the parent activity (the initial way our systems were set up). In late 2016 we introduced recording of income against the child activity as well (to be phased in across live and new awards). \r\n\r\nOur systems do not easily map against the IATI categories for completion / post-completion, therefore we have adopted ‘implementation’ to cover all award activity (e.g. programme activity may have ended but financial reconciliation, etc. is still ongoing). Therefore in some instances an award status may display as ‘implementation’ even after its planned end date.",
    "publisher_data_quality": "Our data is extracted from our award/finance management systems each quarter.  As it is taken directly and unaudited, it offers the highest possible level of transparency on our activities.\r\n\r\nIt is important to publish timely data reflective of the fast-changing nature of Save the Children’s programmes.  This does, however, mean it may differ from the high-quality, audited information that we share through our Annual Report.  For example, our exclusions policy means that the financial information found in our IATI data and Annual Report will not correspond, and for a comprehensive overview the latter document remains the most appropriate source – it is available at: www.savethechildren.org.uk/about-us\r\n"
