    "publisher_description": "Solidaridad is an international civil society organization with more than 45 years of global experience in facilitating the development of socially responsible, ecologically sound and profitable supply chains. Solidaridad works across 13 supply chains and operates through 9 regional offices on 5 continents.\r\n\r\nEnsuring quality of life and a healthy planet for all of us requires continuous effort and mutual cooperation from all parties involved. It also means creating products and processes along supply chains that will help us transition towards a fully inclusive, sustainable economy.\r\n\r\nThere are many values, interests and agendas at play in this transition. And sometimes they conflict. Yet our experience has shown that by connecting, partnering and collaborating with all players, it is possible to reconcile social and ecological responsibilities with supply chain and market realities.\r\n\r\nTo do that, Solidaridad pioneers innovative certification schemes, establishes producer education programmes, supports good business practices, shapes national and international policy, creates new market linkages, builds knowledge-based commodity solutions and more.\r\n\r\nInvesting in structural change – like safeguarding food security, strengthening acceptable labour conditions and a living wage, creating infrastructures for responsible mining, and facilitating access to investment – is the only way to sustain positive impact on the health and livelihoods of people and the planet not just for today, but well into the future.",
    "publisher_organization_type": "21",
    "publisher_record_exclusions": "Initially, the Solidaridad IATI Activity File only includes those activities (projects and programme funds) funded or co-funded by the Dutch Ministry of Foreign Affairs (MinBuZa/DGIS) through its DSO and FLOW II funding programmes. These activities started on or after 1 January 2016. In subsequent quarters activities (co-)funded by other donors will be added to the Solidaridad IATI Activity Files. ",
    "publisher_timeliness": "The Solidaridad Network works with a live cloud-based (Salesforce.com) network-wide information system called Solidaridad Plaza. In Solidaridad Plaza all nine Regional Expertise Centres (REC) of the Solidaridad Network plan, manage, and monitor their sustainable development programmes, both financially and programmatically. On a quarterly basis, the IATI dataset is gleaned from the live Solidaridad Plaza database for each of the nine RECs and published to the Solidaridad IATI website. While the data on Solidaridad Plaza is live, internal (financial) control and reporting at Solidaridad Network level are conducted on a quarterly basis. Thus, toward the end of each quarter, each REC ensures their data in Solidaridad Plaza are up to date and reports to the Solidaridad Network Secretariat as well as to the other RECs. This is also when the Solidaridad IATI dataset is published. ",
    "publisher_source_type": "primary_source",
    "publisher_segmentation": "No, the IATI data are not segmented by country or region. There is one Solidaridad IATI publishing entity for all of Solidaridad's nine Regional Expertise Centres.",
    "publisher_frequency_select": "quarterly",
    "publisher_iati_id": "NL-KVK-51756811",
    "publisher_ui": "Initially, the Solidaridad IATI Activity File will be published in the IATI .xml format only. Together with other IATI publishers Solidaridad will explore options and possibilities for developing and or joining the development of more comprehensive and user-friendly interfaces for online publishing.",
    "publisher_agencies": "Solidaridad is comprised of 9 Regional Expertise Centres (RECs) and a Network Secretariat. The nine Solidaridad RECs are:\r\nREC China\r\nREC SSEA (South and South-East Asia)\r\nREC SECAEC (Central and Eastern Africa)\r\nREC SAF (Southern Africa)\r\nREC WAF (Western Africa)\r\nREC NL (Netherlands/Europe)\r\nREC SAM (South America)\r\nREC CAM (Central America)\r\nREC NA (Northern America)",
    "publisher_constraints": "",
    "publisher_data_quality": "Internal review and approval flows apply to the data of each and every project and programme fund in Solidaridad's cloud-based information system called Solidaridad Plaza. Internal (financial) control and reporting at Solidaridad Network level are conducted on a quarterly basis and external audits of all nine Solidaridad Regional Expertise Centres on an annual basis. "
