    "publisher_description": "Stars Foundation is an independent charity founded and funded by His Excellency Amr. A. Al Dabbagh and the Dabbagh Group of companies. The Foundation’s vision is to “improve the lives of disadvantaged children and their communities globally”. This aspiration is realised through a range of initiatives designed to tackle development challenges in some of the poorest countries in the world.  Through a range of approaches, Stars aims to support local actors to address problems they identify by providing access to funding and non-financial support. \r\nStars believes that well-run local organisations are best placed to respond to the needs of their communities and the young people in their care. All too often however, they are constrained by a rigid approach to partnerships and funding which can limit their effectiveness. \r\nStars’ flagship activity is the annual ‘Impact Awards’ which recognise and reward effective and well-managed local organisations working in the fields of child health, education, protection and WASH (water, sanitation and hygiene). Stars aims to select a winner and runner-up in each field across three regions: Africa-Middle East, Asia-Pacific and Latin America-the Caribbean. The Awards are open to applications from the 100 countries with the highest rates of under-five mortality (http://www.starsfoundation.org.uk/apply/eligibility-2/). ",
