    "publisher_thresholds": "For Incoming funds WaterAid will only publish grants funding specific charitable activities that are above £50k and unrestricted grants above £1m.\r\n\r\nTransactions will be aggregated either annually or by quarter per activity.",
    "publisher_description": "WaterAid transforms lives by improving access to safe water, hygiene and sanitation in the world's poorest communities. We work with partners and influence decision-makers to maximise our impact.\r\n\r\nWaterAid enables the world's poorest people to gain access to safe water and sanitation. Together with improved hygiene, these basic human rights underpin health, education and livelihoods, forming the first essential step in overcoming poverty.\r\n\r\nWe work with local partners, who understand local issues, and provide them with the skills and support to help communities set up and manage practical and sustainable projects that meet their real needs.\r\n\r\nWe also work locally and internationally to change policy and practice and ensure that water, hygiene and sanitation's vital role in reducing poverty is recognised.",
    "publisher_organization_type": "21",
    "publisher_record_exclusions": "For security or commercial reasons a small number of exclusions may  apply in order not to  harm WaterAid’s work or staff. \r\n\r\nThese are based on the key principles of the UK’s Freedom of Information Act and are as follows:\r\n• International relations: Information that may harm WaterAid’s relations with other institutions or governments.\r\n• Security and safety: Information that may jeopardise our ability to function in a specific country or area, pose a risk to the security or safety of any individual, including WaterAid or partner staff/assets, contractors and beneficiaries.\r\n• Personal information: Information that intrudes on the privacy of a person or could contravene confidentiality.\r\n• Commercially sensitive information: Information that does harm to WaterAid’s or WaterAid’s partners or suppliers commercial interests.\r\n• Information that is exempt from disclosure under WaterAid’s policies or regulations:  Where a donor has requested Anonymity or expressed privacy concerns.\r\n\r\nIn addition the following data will be excluded:\r\n• WaterAid forms part of a federation which comprises 4 members currently WaterAid (i.e. WaterAid registered in England & Wales and Scotland), WaterAid America, WaterAid Sweden and WaterAid Australia. Only the information that is relevant to WaterAid will be published.\r\n• Non charitable expenditure ",
    "publisher_timeliness": "Annual data will be available 6 months after the WaterAid financial year close (April). \r\n\r\nQuarterly data will be available one quarter after quarter close.",
    "publisher_source_type": "primary_source",
    "publisher_segmentation": "Initially WaterAid will provide one activity file with activities at organisation and country Level.\r\n\r\nUltimately we are aiming to segment according to:\r\n• One activity file per country (23), or more where there are a large number of activities,\r\n• One activity file for non-specific country activities.",
    "publisher_frequency_select": "not_specified",
    "publisher_iati_id": "GB-CHC-288701",
    "publisher_ui": "We have no plans currently to provide a user interface, however we are in the process of developing a new global website platform, and ultimately presentation of our IATI data in a user friendly format would be beneficial to enable us to share information with our stakeholders and audiences.",
    "publisher_agencies": "WaterAid’s IATI data will cover 100% of WaterAid’s charitable activities. It will not include WaterAid Fundraising and Governance costs and activities meaning 77% of our total income will be reported.\r\n\r\nWaterAid has a PPA with DFID which is unrestricted funding supporting WaterAid’s overall strategy. Therefore in order to comply with the requirements of the PPA WaterAid is planning towards IATI implementation for all its charitable activities.",
    "publisher_constraints": "WaterAid will be conducting a more comprehensive mapping of internal data and processes to the IATI Standard through our Country pilots to determine our current ability to fully comply with the standard.  This will inform our quarterly project level data that will be published from 2013 onwards. Initially the data will cover a sample of Country Programmes but by April 2014, information on all WaterAid Charitable activities will be published. ",
    "publisher_data_quality": "Data will be quality assured as part of the data capture process and WaterAid will not seek to differentiate between data published as unverified or verified. \r\n\r\nThe data will go through an internal process of quality and statistical verification.  This is likely to be manual initially, but will develop as systems evolve to enable digital approval processes and automated data publication."
