    "publisher_description": "World Vision’s main objective is the sustained well-being of children within families and communities, especially the poorest and most vulnerable. We improve the lives of children through long-term development programmes and by providing relief and rehabilitation in response to humanitarian emergencies caused by conflict or natural disaster. Through advocacy and policy engagement we address the root causes of poverty, working with children and their communities as active participants in shaping a better future. World Vision is a Christian organisation and works with people regardless of their religion, race, ethnicity or gender to overcome global poverty and injustice. ",
